import React, { Component } from 'react';

export default class Home extends Component {
  render() {
    return (
      <main>
        <label htmlFor="search">
          Digite algum termo de pesquisa ou escolha uma categoria.
          <input
            data-testid="home-initial-message"
            id="search"
          />
        </label>
      </main>
    );
  }
}
